import styled from "styled-components";

const Container = styled.div`
    background: red;
    height: 475px;
    width: 275px;
    padding: 8px;
`

const Info = styled.div`
    display: flex;
    justify-content: space-between;
`

const Menu = () => {
  return (
    <Container>
      <p>Hello</p>
      <div>
          <span>Killed crops</span>
          <span>5</span>
      </div>
    </Container>
  );
};

export default Menu;
